import { Card ,Table} from 'antd'
import React, { Component } from 'react'
import UserHead from '../../../components/UserHead'

export default class TicketList extends Component {
    render() {
        return (
            <div>
                <UserHead />
                <Card
                    bordered={false}
                >
                    <Table
                        columns={columns}
                        dataSource={data}
                        bordered
                        rowKey="key"
                    />
                </Card>
            </div>
        )
    }
}
